import React from 'react'

export default function Sales({partners,partnerName,paidCount,unpaidCount,total}) {
  return (
    <table class="table table-bordered">
    <thead>
      <tr>
        <th scope="col">Partner Name</th>
        <th scope="col">Paid Order</th>
        <th scope="col">Unpaid Order</th>
        <th scope="col">Total Order</th>
      </tr>
    </thead>
    <tbody>
    {this.state.partners.map((partner)=>{
      return(
      <tr>
        <td>
        {partnerName(partner)}
        </td>
        <td>
        {paidCount(partner)}
        </td>
        <td>
        {unpaidCount(partner)}
        </td>
        <td>
        {total(partner)}
        </td>
      </tr>
      )
      })}
    </tbody>
    </table>
  )
}
